INSERT INTO chart_query (C_QUERY_ID, API_QUERY, QUERY_TYPE, LEGEND, QUERY_STEP, CREATE_TIME, UPDATE_TIME, PANEL_ID) values (	1	,	 '/api/v1/query?query=sum(node_uname_info{zone!="external"})'	,	 'METRIC'	,	 ''	,	 '240'	,	CURRENT_TIMESTAMP()	,	CURRENT_TIMESTAMP()	,	1	);
INSERT INTO chart_query (C_QUERY_ID, API_QUERY, QUERY_TYPE, LEGEND, QUERY_STEP, CREATE_TIME, UPDATE_TIME, PANEL_ID) values (	2	,	 '/api/v1/query?query=sum(count(count(node_cpu_seconds_total{zone!="external"}) by (cpu, node)) by (cpu))'	,	 'METRIC'	,	 ''	,	 '240'	,	CURRENT_TIMESTAMP()	,	CURRENT_TIMESTAMP()	,	2	);
INSERT INTO chart_query (C_QUERY_ID, API_QUERY, QUERY_TYPE, LEGEND, QUERY_STEP, CREATE_TIME, UPDATE_TIME, PANEL_ID) values (	3	,	 '/api/v1/query?query=(1 - avg(irate(node_cpu_seconds_total{mode="idle",node=~"^.*$", zone!="external"}[5m]))) * 100'	,	 'METRIC'	,	 ''	,	 '240'	,	CURRENT_TIMESTAMP()	,	CURRENT_TIMESTAMP()	,	3	);
